@Component({
  selector: 'app-action-buttons',
  standalone: false,
  templateUrl: './action-buttons.html',
  styleUrl: './action-buttons.scss'
})
export class ActionButtons {

}
<div class="flex gap-3 justify-end">
  <button class="bg-cyan-700 hover:bg-cyan-600 px-4 py-1.5 rounded text-sm font-semibold text-white">
    Run Code
  </button>
  <button class="bg-green-700 hover:bg-green-600 px-4 py-1.5 rounded text-sm font-semibold text-white">
    Submit
  </button>
</div>
